static int test_fmal(void) {
    unsigned int i;
    int result = 0;
    for (i = 0; i < sizeof(fmal_vec)/sizeof(fmal_vec[0]); i++) {
        long double y = fmal(fmal_vec[i].x0, fmal_vec[i].x1, fmal_vec[i].x2);
        result += check_long_double("fmal", fmal_vec[i].line, FMAL_PREC, fmal_vec[i].y, y);
    }
    return result;
}
